import React from 'react';
import './Sidebar.css';

const Sidebar = () => {
    return(
        <div className="sidebar">
            <h3>Sidebar</h3>
            <div className="sidebar__counts">
                <div className="count">15<div className="count_text">Total Task</div></div>
            </div>
        </div>
    )
}

export default Sidebar;
